    <script type="text/javascript">
        $(function() {
            var btnplayers = document.getElementsByClassName('btn-play');
            showPlayer(btnplayers[0].getAttribute('id'));
            btnplayers[0].classList.remove('btn-primary')
            btnplayers[0].classList.add('btn-danger')
            btnplayers[0].disabled = true;

            closeServer();
            $('body').on('click', '#show-server', function(e) {

                e.preventDefault();
                $(".list-server-items").toggle();
            });
            $('body').on('click', '.linkserver', function(e) {

                e.preventDefault();
                var link = $(this).attr('data-video');
                var data_status = $(this).attr('data-status');
                if ($(this).hasClass("active")) {
                    return false;
                } else {
                    pasangIframe(link);
                    $('.list-server-items li').removeClass('active');
                    $(this).addClass('active');
                    closeServer();
                }

            });
            $("#img_canvas").width($(document).width());
            $("#img_canvas").height($(document).height());

            function closeServer() {
                setTimeout(function() {
                    $('.list-server-items').fadeOut();
                }, 5000)
            }

            function pasangIframe(e) {
                var h = $(window).height() - 35;
                $("#myElement").html('<iframe id="img_canvas" src="' + e +
                    '" frameborder=0 marginwidth=0 marginheight=0 scrolling=no width="' + $(window).width() + '" height="' + h + '" allowfullscreen ></iframe>');
            }




            function showPlayer(link_id) {
                var datas = "videos=" + $('meta[name="token"]').attr('content') + "&player=" + link_id;
                $.ajax({
                    async: true,
                    url: "{{ route('getPlayer')}}",
                    type: "POST",
                    data: datas,
                    cache: false,
                    beforeSend: function() {
                        $("#myElement").html(
                            '<div class="spinner"><div class="bounce1"></div> <div class="bounce2"></div> <div class="bounce3"></div></div><div id="notif" class="text-center"><p style="color: blue;">Tunggu Sebentar Ya... :D :)</p></div>');
                    },
                    success: function(html) {
                        if (html) {
                            $(".list-server-items").html(html);
                            var btnplayers2 = document.getElementsByClassName("linkserver");
                            pasangIframe(btnplayers2[0].getAttribute("data-video"));
                        } else {
                            alert('Sorry, unexpected error. Please try again later.');
                        }
                    },
                    error: function($html) {
                        $("#myElement").html(
                            '<div id="notif" class="text-center"> <p style = "color: blue;" > Pilih Server Di atas!!! </br> Jangan Gunakan UCbrowser atau Browser mini lainnya!!! </br> Jika Error Cepat Lapor Mimin atau Komentar di bawah... :D :)</p></div>'
                        );
                    }
                });
                return false;
            }

            $('.btn-play').click(function() {
                $("#myElement").html(
                    '<div class="spinner"><div class="bounce1"></div> <div class="bounce2"></div> <div class="bounce3"></div></div><div id="notif" class="text-center"><p style="color: blue;">Tunggu Sebentar Ya... :D :)</p></div>'
                );
                showPlayer($(this).attr('id'));
                $('.btn-play').prop('disabled', false);
                $('.btn-play').removeClass('btn-danger');
                $(this).prop('disabled', true);
                $('.btn-play').addClass('btn-primary');
                $(this).removeClass('btn-primary').addClass('btn-danger');
            });
            // $("#img_canvas").load(function() {
            //     $(this).height(h);
            //     $(this).width(w);
            // });
        });
